// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

/// @title AuthenticationSuite.sol
/// @notice On-chain analogues of “Authentication” patterns:
///   Types: Basic, Digest, OAuth, MultiFactor  
///   AttackTypes: BruteForce, Replay, Phishing, TokenTheft  
///   DefenseTypes: RateLimit, NonceChallenge, TwoFactor, SessionManagement  

enum AuthenticationType        { Basic, Digest, OAuth, MultiFactor }
enum AuthenticationAttackType  { BruteForce, Replay, Phishing, TokenTheft }
enum AuthenticationDefenseType { RateLimit, NonceChallenge, TwoFactor, SessionManagement }

error AUTH__TooManyAttempts();
error AUTH__InvalidNonce();
error AUTH__BadCredentials();
error AUTH__No2FA();
error AUTH__SessionExpired();

////////////////////////////////////////////////////////////////////////////////
// 1) VULNERABLE AUTHENTICATOR
//
//    • no rate-limit, no nonces, no 2FA → BruteForce, Replay
////////////////////////////////////////////////////////////////////////////////
contract AuthenticationVuln {
    mapping(address => bytes32) public passwordHash;
    event LoginAttempt(
        address indexed who,
        AuthenticationType   atype,
        bool                 success,
        AuthenticationAttackType attack
    );

    /// set password hash (keccak256 of password)
    function setPassword(bytes32 hash_) external {
        passwordHash[msg.sender] = hash_;
    }

    /// ❌ naive login: direct comparison
    function login(bytes32 guess) external {
        bool ok = (passwordHash[msg.sender] == guess);
        emit LoginAttempt(msg.sender, AuthenticationType.Basic, ok, AuthenticationAttackType.BruteForce);
    }
}

////////////////////////////////////////////////////////////////////////////////
// 2) ATTACK STUB
//
//    • brute-force many guesses, replay captured hashes
////////////////////////////////////////////////////////////////////////////////
contract Attack_Authentication {
    AuthenticationVuln public target;
    constructor(AuthenticationVuln _t) { target = _t; }

    /// brute force by iterating guesses
    function bruteForce(bytes32[] calldata guesses) external {
        for (uint i = 0; i < guesses.length; i++) {
            target.login(guesses[i]);
        }
    }

    /// replay a known hash
    function replay(bytes32 knownHash) external {
        target.login(knownHash);
    }
}

////////////////////////////////////////////////////////////////////////////////
// 3) SAFE WITH RATE-LIMITING
//
//    • Defense: RateLimit – cap login attempts per block
////////////////////////////////////////////////////////////////////////////////
contract AuthenticationSafeRateLimit {
    mapping(address => bytes32) public passwordHash;
    mapping(address => uint256) public lastBlock;
    mapping(address => uint256) public attemptsInBlock;
    uint256 public constant MAX_PER_BLOCK = 5;

    event LoginAttempt(
        address indexed who,
        AuthenticationType   atype,
        bool                 success,
        AuthenticationDefenseType defense
    );

    error AUTH__TooManyAttempts();

    function setPassword(bytes32 hash_) external {
        passwordHash[msg.sender] = hash_;
    }

    function login(bytes32 guess) external {
        if (block.number != lastBlock[msg.sender]) {
            lastBlock[msg.sender]      = block.number;
            attemptsInBlock[msg.sender] = 0;
        }
        attemptsInBlock[msg.sender]++;
        if (attemptsInBlock[msg.sender] > MAX_PER_BLOCK) revert AUTH__TooManyAttempts();

        bool ok = (passwordHash[msg.sender] == guess);
        emit LoginAttempt(msg.sender, AuthenticationType.Basic, ok, AuthenticationDefenseType.RateLimit);
    }
}

////////////////////////////////////////////////////////////////////////////////
// 4) SAFE WITH NONCE-CHALLENGE (Digest-style)
// 
//    • Defense: NonceChallenge – require per-session nonce and response
////////////////////////////////////////////////////////////////////////////////
contract AuthenticationSafeNonce {
    mapping(address => bytes32) public passwordHash;
    mapping(address => bytes32) public currentNonce;
    event Challenge(
        address indexed who,
        bytes32            nonce,
        AuthenticationDefenseType defense
    );
    event LoginAttempt(
        address indexed who,
        AuthenticationType   atype,
        bool                 success,
        AuthenticationDefenseType defense
    );

    error AUTH__InvalidNonce();
    error AUTH__BadCredentials();

    function setPassword(bytes32 hash_) external {
        passwordHash[msg.sender] = hash_;
    }

    /// issue a nonce to the caller
    function requestChallenge() external {
        bytes32 nonce = keccak256(abi.encodePacked(msg.sender, block.timestamp));
        currentNonce[msg.sender] = nonce;
        emit Challenge(msg.sender, nonce, AuthenticationDefenseType.NonceChallenge);
    }

    /// login with response = keccak256(nonce || password)
    function login(bytes32 response) external {
        bytes32 nonce = currentNonce[msg.sender];
        if (nonce == bytes32(0)) revert AUTH__InvalidNonce();
        bytes32 expected = keccak256(abi.encodePacked(nonce, passwordHash[msg.sender]));
        delete currentNonce[msg.sender];
        bool ok = (response == expected);
        if (!ok) revert AUTH__BadCredentials();
        emit LoginAttempt(msg.sender, AuthenticationType.Digest, ok, AuthenticationDefenseType.NonceChallenge);
    }
}

////////////////////////////////////////////////////////////////////////////////
// 5) SAFE MULTI-FACTOR WITH SESSION MANAGEMENT
//
//    • Defense: TwoFactor + SessionManagement – require OTP and track session expiry
////////////////////////////////////////////////////////////////////////////////
contract AuthenticationSafe2FA {
    mapping(address => bytes32) public passwordHash;
    mapping(address => bool)    public otpPassed;
    mapping(address => uint256) public sessionExpiry;
    uint256 public constant SESSION_DURATION = 1 hours;

    event OTPVerified(address indexed who, AuthenticationDefenseType defense);
    event LoginAttempt(
        address indexed who,
        AuthenticationType   atype,
        bool                 success,
        AuthenticationDefenseType defense
    );

    error AUTH__No2FA();
    error AUTH__SessionExpired();
    error AUTH__BadCredentials();

    function setPassword(bytes32 hash_) external {
        passwordHash[msg.sender] = hash_;
    }

    /// caller supplies OTP (stubbed off-chain generation)
    function verifyOTP(bytes32 otp) external {
        // stub check: otp must equal keccak256(msg.sender||blockhash)
        bytes32 expected = keccak256(abi.encodePacked(msg.sender, blockhash(block.number - 1)));
        require(otp == expected, "invalid OTP");
        otpPassed[msg.sender] = true;
        emit OTPVerified(msg.sender, AuthenticationDefenseType.TwoFactor);
    }

    /// login with password after OTP
    function login(bytes32 guess) external {
        if (!otpPassed[msg.sender]) revert AUTH__No2FA();
        if (block.timestamp > sessionExpiry[msg.sender]) revert AUTH__SessionExpired();
        otpPassed[msg.sender] = false;

        bool ok = (passwordHash[msg.sender] == guess);
        if (!ok) revert AUTH__BadCredentials();
        sessionExpiry[msg.sender] = block.timestamp + SESSION_DURATION;
        emit LoginAttempt(msg.sender, AuthenticationType.MultiFactor, ok, AuthenticationDefenseType.SessionManagement);
    }
}

